import React from 'react'
import { Offers } from '../Offers/Offers'

export const AboutUs = (props) => {
  return (
    <div>
        
        <Offers product={props.state.product} type="new" title="Нові моделі" />
      <Offers
        product={props.state.product}
        type="popular"
        title="Популярні моделі"
      />
    </div>
  )
}
